import { StyledCard } from "./style";
import { HiTrash } from "react-icons/hi2";
import { useContext } from "react";
import { TechContext } from "../../Contexts/TechContext";

export const CardTecnology = ({ title, status }) => {
  const { deleteTech, load } = useContext(TechContext);
  return (
    <StyledCard>
      <h3>{title}</h3>
      <div>
        <span>{status}</span>
        <button>
          <HiTrash />
        </button>
      </div>
    </StyledCard>
  );
};
